import React, { useState, useEffect } from 'react';
import axios from 'axios';

const LogDisplay = () => {
  const [data, setData] = useState([]);
  const [activeLog, setActiveLog] = useState('wp_s3cu_form_on_landing');

  useEffect(() => {
    const fetchData = async () => {
      const result = await axios.get(`https://localhost/backend/process_data.php?api=${activeLog}`);
      setData(result.data);
    };

    fetchData();
  }, [activeLog]);

  return (
    <div>
      <button onClick={() => setActiveLog("wp_s3cu_form_on_landing")}>
        Show WP_s3cu_form_on_landing
      </button>
      <button onClick={() => setActiveLog("apache_logs")}>
        Show Apache Logs
      </button>
      <table>
        <tbody>
          {data.map((item, index) => (
            <tr key={index}>
                {Object.values(item).map((value, i) => <td key={i}>{value}</td>)}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default DisplayData;
